import React from 'react';
import '../styles/Dashboard2.css'; // 이 페이지 전용 CSS

// 차트 이미지 예시로 maingraph.svg를 사용합니다.
import ChartImage from '../assets/imgs/maingraph.svg';

// --- 예시 데이터 (나중에 실제 데이터로 대체) ---
const mockData = [
  { rank: 1, name: '김OO', score: 97, job: 'Back-End' },
  { rank: 2, name: '박OO', score: 96, job: 'Back-End' },
  { rank: 3, name: '이OO', score: 96, job: 'Front-End' },
  { rank: 4, name: '최OO', score: 96, job: 'Back-End' },
  { rank: 5, name: '김OO', score: 95, job: 'Front-End' },
  { rank: 6, name: '박OO', score: 95, job: 'Back-End' },
  { rank: 7, name: '김OO', score: 94, job: 'Front-End' },
  { rank: 8, name: '박OO', score: 94, job: 'Front-End' },
  { rank: 9, name: '이OO', score: 94, job: 'Front-End' },
  { rank: 10, name: '이OO', score: 93, job: 'Back-End' },
  { rank: 11, name: '최OO', score: 93, job: 'Back-End' },
  { rank: 12, name: '조OO', score: 92, job: 'Back-End' },
  { rank: 13, name: '김OO', score: 91, job: 'Front-End' },
  { rank: 14, name: '박OO', score: 91, job: 'Front-End' },
  { rank: 15, name: '이OO', score: 91, job: 'Back-End' },
  { rank: 16, name: '홍OO', score: 91, job: 'Back-End' },
  { rank: 17, name: '박OO', score: 90, job: 'Front-End' },
  { rank: 18, name: '이OO', score: 90, job: 'Back-End' },
  { rank: 19, name: '최OO', score: 89, job: 'Back-End' },
  { rank: 20, name: '김OO', score: 89, job: 'Front-End' },
  { rank: 21, name: '박OO', score: 89, job: 'Back-End' },
  { rank: 22, name: '김OO', score: 88, job: 'Front-End' },
  { rank: 23, name: '박OO', score: 87, job: 'Front-End' },
  { rank: 24, name: '이OO', score: 87, job: 'Front-End' },
  { rank: 25, name: '이OO', score: 87, job: 'Back-End' },
  { rank: 26, name: '최OO', score: 86, job: 'Back-End' },
  { rank: 27, name: '조OO', score: 86, job: 'Back-End' },
  { rank: 28, name: '김OO', score: 85, job: 'Front-End' },
  { rank: 29, name: '박OO', score: 84, job: 'Front-End' },
  { rank: 30, name: '이OO', score: 83, job: 'Back-End' },
];

// 1~15위 / 16~30위 데이터 분리
const column1Data = mockData.slice(0, 15);
const column2Data = mockData.slice(15, 30);


// --- 컴포넌트 ---
const Dashboard2 = () => {
  return (
    // Dashboard1과 달리 밝은 배경의 메인 콘텐츠 영역
    <main className="dashboard-content-light">

      {/* 1. 통계 지표 섹션 */}
      <section className="dashboard-section">
        <div className="section-header">
          <h2>통계지표</h2>
        </div>

        {/* 1-1. 통계 박스 3개 */}
        <div className="stat-boxes-container">
          <div className="stat-box">
            <p>전체 지원자 수</p>
            <h3>1,294 <span>명</span></h3>
          </div>
          <div className="stat-box">
            <p>서류 합격자 수</p>
            <h3>103 <span>명</span></h3>
          </div>
          <div className="stat-box">
            <p>평균 점수</p>
            <h3>79.3 <span>점</span></h3>
          </div>
        </div>

        {/* 1-2. 차트 2개 */}
        <div className="charts-container">
          <div className="chart-box">
            <img src={ChartImage} alt="월별 지원자 수 차트 예시" />
          </div>
          <div className="chart-box">
            <img src={ChartImage} alt="월별 합격자 수 차트 예시" />
          </div>
        </div>
      </section>

      {/* 2. 지원자 순위 섹션 */}
      <section className="dashboard-section">
        <div className="section-header">
          <h2>지원자 순위</h2>
        </div>

        {/* 2-1. 지원자 목록 (2열 그리드) */}
        <div className="applicant-list-container">

          {/* 왼쪽 열 (1-15위) */}
          <div className="applicant-list-column">
            <ApplicantListHeader />
            {column1Data.map((item) => (
              <ApplicantRow key={item.rank} data={item} />
            ))}
          </div>

          {/* 오른쪽 열 (16-30위) */}
          <div className="applicant-list-column">
            <ApplicantListHeader />
            {column2Data.map((item) => (
              <ApplicantRow key={item.rank} data={item} />
            ))}
          </div>

        </div>
      </section>

    </main>
  );
};

// --- 하위 컴포넌트 ---

// 지원자 리스트 헤더 (순위, 이름, 점수...)
const ApplicantListHeader = () => (
  <div className="applicant-row-header">
    <span>순위</span>
    <span>이름</span>
    <span>종합점수</span>
    <span>직무</span>
    <span>원본확인</span>
  </div>
);

// 지원자 한 줄(Row) 컴포넌트
// props로 data(순위, 이름 등)를 받습니다.
const ApplicantRow = ({ data }) => {
  // 직무에 따라 CSS 클래스를 동적으로 부여
  const jobTagClass = data.job === 'Back-End' ? 'job-tag-backend' : 'job-tag-frontend';

  return (
    <div className="applicant-row">
      <span className="rank">{data.rank}</span>
      <span className="name">{data.name}</span>
      <span className="score">{data.score}</span>
      <span className="job">
        <span className={`job-tag ${jobTagClass}`}>{data.job}</span>
      </span>
      {/* 아이콘이 없어서 화살표 텍스트로 대체 */}
      <span className="link-arrow">→</span>
    </div>
  );
};

export default Dashboard2;
